<template>
  <div style="display: flex;justify-content: space-evenly">
    <div class="material__record__container">
      <div>
        <div style="display: flex;justify-content: center;width: 100%;align-items: center;margin-bottom: 5px;margin-top: 5px;">
          <div style="width: 100%;">
            <vs-input v-model="recordValue" color="success" placeholder="请输入需要搜索的交易记录" style="width: 100%">
              <template #icon>
                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-search" viewBox="0 0 16 16">
                  <path d="M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001c.03.04.062.078.098.115l3.85 3.85a1 1 0 0 0 1.415-1.414l-3.85-3.85a1.007 1.007 0 0 0-.115-.1zM12 6.5a5.5 5.5 0 1 1-11 0 5.5 5.5 0 0 1 11 0z"/>
                </svg>
              </template>
            </vs-input>
          </div>
          <div>
            <vs-button block style="width: 100px">
              搜索
            </vs-button>
          </div>
        </div>
      </div>
      <div class="material__main">
        <div style="display: flex;flex-direction: column;width: 100%;">
          <div class="card">
            <div id="trace" ref="trace" style="width: 100%;height: 110px;;padding-right: 25%;"></div>
          </div>
          <div>
            <vs-table striped style="width: 100%" v-model="record">
              <template #thead>
                <vs-tr>
                  <vs-th style="width: 80px"> 物资ID </vs-th>
                  <vs-th> 物品分类 </vs-th>
                  <vs-th> 物品名称 </vs-th>
                  <vs-th> 捐赠数量 </vs-th>
                  <vs-th> 捐赠用户 </vs-th>
                  <vs-th> 签收状态 </vs-th>
                  <vs-th style="width: 200px"> 捐赠时间 </vs-th>
                </vs-tr>
              </template>
              <template #tbody>
                <vs-tr v-for="(item, index) in getPage(tableData,queryParams.pageNum,queryParams.pageSize)" :key="index" :data="item">
                  <vs-td>
                    {{ item.charityId }}
                  </vs-td>
                  <vs-td>
                    {{ getMaterialType(item.materialType) }}
                  </vs-td>
                  <vs-td>
                    {{ item.materialName }}
                  </vs-td>
                  <vs-td>
                    {{ item.materialCount }}
                  </vs-td>
                  <vs-td>
                    {{ item.sourceAddress }}
                  </vs-td>
                  <vs-td v-if="!item.isSign">
                    <vs-button
                        upload
                        icon
                        color="danger"
                        type="flat"
                        :active="isSignActive == 1"
                        @click="isSignActive = 1"
                    >
                      待签收
                    </vs-button>
                  </vs-td>
                  <vs-td v-if="item.isSign">
                    <vs-button
                        upload
                        icon
                        color="success"
                        type="flat"
                        :active="isSignActive == 1"
                        @click="isSignActive = 1"
                    >
                      已签收
                    </vs-button>
                  </vs-td>
                  <vs-td>
                    {{ item.transTime }}
                  </vs-td>

                  <template #expand>
                    <div style="height: 60px">
                      <h2 class="expand__p">区块高度: <span class="expand__span">{{transaction.blockNumber}}</span></h2>
                      <h2 class="expand__p">交易哈希: <span class="expand__span">{{transaction.transactionHash}}</span></h2>

                    </div>
                  </template>
                </vs-tr>
              </template>
              <template #footer>
                <vs-pagination
                    v-model:current-page="queryParams.pageNum"
                    v-model:page-size="queryParams.pageSize"
                    :page-sizes="[10, 15, 20]"
                    :total="total"
                />
              </template>
            </vs-table>
          </div>
        </div>
        <div>
        </div>
      </div>
    </div>
    <div style="width: 40%;padding: 10px 10px">
      <div class="transaction__card">
        <div class="search">
          <vs-input v-model="transactionHash" state="primary" placeholder="请输入交易哈希查询交易回执" style="width: 98%" @keyup.enter="handleSearchTransactionByHash">
            <template #icon>
              <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-lightning-fill" viewBox="0 0 16 16">
                <path d="M5.52.359A.5.5 0 0 1 6 0h4a.5.5 0 0 1 .474.658L8.694 6H12.5a.5.5 0 0 1 .395.807l-7 9a.5.5 0 0 1-.873-.454L6.823 9.5H3.5a.5.5 0 0 1-.48-.641l2.5-8.5z"/>
              </svg>
            </template>
          </vs-input>
        </div>
        <div style="padding: 10px 10px" >
          <vs-alert v-model:page="page"  type="shadow">
            <template #title v-if="page == 1"> 交易信息 </template>
            <template #title v-if="page == 2"> 交易回执 </template>
            <template #page-1>
              <div v-if="transactionActive == 0"  style="height: 600px;display: flex;justify-content: center;flex-direction: column;align-items: center">
