              <div style="height: 600px" v-if="transactionActive == 1">
                <h2 class="expand__p">Output: <span class="expand__span">{{transaction_receipt.output}}</span></h2>
                <h2 class="expand__p">BlockHash: <span class="expand__span">{{transaction_receipt.blockHash}}</span></h2>
                <h2 class="expand__p">GasUsed: <span class="expand__span">{{transaction_receipt.gasUsed}}</span></h2>
                <h2 class="expand__p">BlockNumber: <span class="expand__span">{{transaction_receipt.blockNumber}}</span></h2>
                <h2 class="expand__p">ContractAddress: <span class="expand__span">{{transaction_receipt.contractAddress}}</span></h2>
                <h2 class="expand__p">From: <span class="expand__span">{{transaction_receipt.from}}</span></h2>
                <h2 class="expand__p">TransactionIndex: <span class="expand__span">{{transaction_receipt.transactionIndex}}</span></h2>
                <h2 class="expand__p">To: <span class="expand__span">{{transaction_receipt.to}}</span></h2>
                <h2 class="expand__p">LogsBloom: <span class="expand__span">{{transaction_receipt.logsBloom}}</span></h2>
                <h2 class="expand__p">TransactionHash: <span class="expand__span">{{transaction_receipt.transactionHash}}</span></h2>
                <h2 class="expand__p">Status: <span class="expand__span">{{transaction_receipt.status}}</span></h2>
