  </div>
</template>

<script setup>
import * as echarts from 'echarts'
import {onMounted, reactive, ref, toRefs, watch} from "vue";
import {getPage, VsLoadingFn} from "vuesax-alpha";
import {
  selectMaterialRelationship,
  selectTransactionHashAndBlockNumberByMaterialId,
  selectUserDonationMaterialRecord
} from "@/api/charity/record.js";
import {getTransactionInfo} from "@/api/blockchain/blockchain.js";

const isSignActive = ref(0)
const $content = ref()
const transactionActive = ref(0)
const page = ref(1)
const transaction = ref({})
const transactionHash = ref()
const transaction_detail = ref({})
const transaction_receipt = ref({})
const startName = ref('')
const middleName = ref('')
const endName = ref('')
const record = ref({})
const trace = ref()
const total = ref(0)
const options = reactive([
  {
    label: "食品和饮用水",
    value: 1
  },
  {
    label: "床上用品和衣物",
    value: 2
  },
  {
    label: "医疗物资",
    value: 3
  },
  {
    label: "生活用品",
    value: 4
  },
  {
    label: "儿童和老人用品",
    value: 5
  },
  {
    label: "建筑和维修材料",
    value: 6
  }
])
const data = reactive({
  queryParams: {
    pageNum: 1,
    pageSize: 10
  },
  tableData: [],
  option: {
    tooltip: {},
    xAxis: { show: false, type: 'value' },
    yAxis: { show: false, type: 'value' },
    series: [
      {
        type: 'graph',
        coordinateSystem: 'cartesian2d',
        roam: true,
        label: { show: true, position: 'bottom', color: '#000' },
        symbol:
            'image://data:image/png;base64,',
        symbolSize: [70, 55],
        data: [
          {
            name: startName,
            value: [90, 0],
          },
          {
            name: middleName,
            value: [200, 0],
          },
          {
            name: endName,
            value: [300, 0],
          },
          {
            name: '发放物资',
            value: [400, 0],
          },
        ],
      },
      {
        type: 'lines',
        coordinateSystem: 'cartesian2d',
        effect: { show: true, trailLength: 0, symbol: 'arrow', color: 'blue', symbolSize: 8 },
        lineStyle: { curveness: 0.2, color: 'black' },
        label: { show: true },
        data: [
          {
            coords: [
              [90, 0],
              [200, 0],
            ],
          },
          {
            coords: [
              [200, 0],
              [300, 0],
            ],
          },
          {
            coords: [
              [300, 0],
              [400, 0],
            ],
          },
        ],
      },
    ],
  }
})
const {tableData,queryParams,option} = toRefs(data)

function getMaterialType(val){
  let label
  options.forEach(item => {
    if (val == item.value) {
      label =  item.label
    }
  })
  return label
}

watch(record,(val,old) => {
  selectMaterialRelationship({activityId: val.charityId}).then(res => {
    startName.value = res.data[2]
    middleName.value = res.data[1]
    endName.value = res.data[0]

    var traceEcharts = echarts.init(trace.value);
    traceEcharts.setOption(option.value)
  })

  selectTransactionHashAndBlockNumberByMaterialId({activityId: val.charityId}).then(res => {
    transaction.value = res.data
  })

})
function handleSearchTransactionByHash(){
  getTransactionInfo({hash: transactionHash.value}).then(res => {
    transaction_detail.value = res.transaction
    transaction_receipt.value = res.transactionReceipt

    transactionActive.value = 1
    const loadingInstance = VsLoadingFn({
      target: $content,
    })
    setTimeout(() => {
      loadingInstance.close()
    }, 1000)

  })
}

onMounted(() => {
  selectUserDonationMaterialRecord().then(res => {
    total.value = res.total
    tableData.value = res.rows

    selectMaterialRelationship({activityId: res.rows[0].charityId}).then(res => {
      startName.value = res.data[2]
      middleName.value = res.data[1]
      endName.value = res.data[0]

      var traceEcharts = echarts.init(trace.value);
      traceEcharts.setOption(option.value)
    })
  })

  const loadingInstance = VsLoadingFn({
    target: $content,
  })
  setTimeout(() => {
    loadingInstance.close()
  }, 1000)
})

</script>


